import { useSelector } from "react-redux";
import { RootState } from "../store/store";
import { Checkbox } from 'antd';
import type { CheckboxProps } from 'antd';

export function SideNavigation() {
  const filterData = useSelector((state: RootState) => state.filter);
  const onChange: CheckboxProps['onChange'] = (e) => {
    console.log(`checked = ${e.target.checked}`);
  };

  return (
    <form className="space-y-4">
      {filterData.map((filterCatagory, idx) => {
        switch (filterCatagory.input_type) {
          case "checkbox":
            return (
              <div key={idx}>
                <p>{filterCatagory.type}</p>
                {filterCatagory.options.map((option, oIdx) => (
                  <Checkbox key={oIdx} onChange={onChange}>
                    {option.text}
                  </Checkbox>
                ))}
              </div>
            );
          case "link_with_icon":
            return (
              <div key={idx}>
                <p>Refine Result</p>
                {filterCatagory.options.map((option, oIdx) => (
                  <div key={oIdx}>
                    {option.text}
                  </div>
                ))}
              </div>
            );
          default:
            return null;
        }
      })}
    </form>
  );
}
